import React, { Component } from 'react';
import './Resume.css'
import ProgressBar from './ProgressBar/ProgressBar'

class Resume extends Component {

    render() {

        return(
            <div className='resume' id={this.props.id}>
                <h3>Resume</h3>
                <h4>Education</h4>
                <h5>University of London - Bachelors of Science Computer Science</h5>
                <p>October 2019 - 2023</p>
                <h5> Harvardx - CS50x</h5>
                <p>June - September 2019</p>
                <h4>Experience</h4>
                <h5>Business Operations Coordinator - City of Pitt Meadows</h5>
                <p>November 2016 - Present</p>
            </div>

        )
    }

}

export default Resume;
